printSprite:
    ; Set video mode to 13h (320x200 pixels, 256 colors).
    mov ax, 0x0013
    int 0x10

    ; Set up the segment registers.
    mov ax, 0xA000 ; Video memory segment for mode 13h.
    mov es, ax
